class CifarAutoencoder(nn.Module):
    def __init__(self):
        super(CifarAutoencoder, self).__init__()

        # Encoder layers
        self.encoder = nn.Sequential(
            nn.Conv2d(3, 16, kernel_size=3, stride=1, padding=1),
            nn.BatchNorm2d(16),
            nn.LeakyReLU(0.2),
            nn.MaxPool2d(2, stride=2),

            nn.Conv2d(16, 32, kernel_size=3, stride=1, padding=1),
            nn.BatchNorm2d(32),
            nn.LeakyReLU(0.2),
            nn.MaxPool2d(2, stride=2),

            nn.Conv2d(32, 64, kernel_size=3, stride=1, padding=1),
            nn.BatchNorm2d(64),
            nn.LeakyReLU(0.2),
            nn.MaxPool2d(2, stride=2)
        )

        # Decoder layers
        self.decoder = nn.Sequential(
            nn.ConvTranspose2d(64, 32, kernel_size=3, stride=2, padding=1, output_padding=1),
            nn.BatchNorm2d(32),
            nn.LeakyReLU(0.2),

            nn.ConvTranspose2d(32, 16, kernel_size=3, stride=2, padding=1, output_padding=1),
            nn.BatchNorm2d(16),
            nn.LeakyReLU(0.2),

            nn.ConvTranspose2d(16, 3, kernel_size=3, stride=2, padding=1, output_padding=1),
            nn.Tanh()  # Tanh activation to ensure output is in the range [-1, 1]
        )

    def forward(self, x):
        x = self.encoder(x)
        x = self.decoder(x)
        return x

def train_model(model, train_dataloader, optimizer, loss_func, num_epochs):
    model.train()
    losses = []

    for epoch in range(num_epochs):
        running_loss = 0.0
        for data in train_dataloader:
            inputs = data.clone().to(torch.device('cuda'))

            # Apply masking
            inputs[:, :, :, 16:32] = -1  # Set columns 16 to 32 to -1 (black pixels)

            optimizer.zero_grad()
            outputs = model(inputs)

            # Use the original image as the ground truth for the loss
            loss = loss_func(outputs, data.to(torch.device('cuda')))

            loss.backward()
            optimizer.step()

            running_loss += loss.item()

        epoch_loss = running_loss / len(train_dataloader)
        losses.append(epoch_loss)

        print(f"Epoch {epoch+1}/{num_epochs}, Loss: {epoch_loss:.4f}")

    return losses

def evaluate_model(model, test_dataloader):
    model.eval()
    total_loss = 0.0

    with torch.no_grad():
        for data in test_dataloader:
            inputs = data.clone().to(torch.device('cuda'))

            # Apply masking
            inputs[:, :, :, 16:32] = -1  # Set columns 16 to 32 to -1 (black pixels)

            outputs = model(inputs)
            loss = F.mse_loss(outputs, data.to(torch.device('cuda')))
            total_loss += loss.item()

    average_loss = total_loss / len(test_dataloader)
    print(f"Average Test Loss: {average_loss:.4f}")

    return average_loss

def visualize_inpainting(model, dataset):
    seed_everything(464)
    dataloader = DataLoader(dataset, batch_size=10, shuffle=True)
    images = next(iter(dataloader)) # Taking one batch from the dataloader
    images = images
    model.eval()
    with torch.no_grad():
      masked_images = images.clone()
      masked_images[:,:,:,16:] = -1
      inpainted_images = model(masked_images.cuda()).cpu()
    images = (images + 1) / 2
    masked_images = (masked_images + 1) / 2
    inpainted_images = (inpainted_images + 1) / 2
    images_concat = torch.cat((images, masked_images, inpainted_images), dim=2)
    grid_img = torchvision.utils.make_grid(images_concat, nrow=10)
    plt.axis('off')
    plt.imshow(grid_img.permute(1, 2, 0))
    plt.show()

